import * as React from "react";
import { LogoProps } from "../types";

export const Logo: React.FC<LogoProps> = ({ imageUrl, title }) => {
  return (
    <div className="flex gap-3 px-8 py-6 text-xl max-md:px-5">
      <img
        loading="lazy"
        src={imageUrl}
        alt=""
        className="object-contain shrink-0 self-start aspect-square w-[60px]"
      />
      <div className="w-[239px]">
        <span className="text-4xl text-gray-200">{title.charAt(0)}</span>
        <span className="text-gray-200">{title.slice(1)}</span>
      </div>
    </div>
  );
};
